import './App.css';

function App() {
  return (
    <div>
      <img src="https://i.redd.it/ldfi6xzs56t51.png" width="80%" height="auto" />
      <img src="https://upload.wikimedia.org/wikipedia/commons/0/0e/Basic_red_dot.png" width="10%" height="10%"/>
    </div>
  );
}

export default App;
